import React from 'react';

class Child extends React.Component{
    render(){
        return <div>
        <h4>General</h4>
        <p className='line'>About forwarding limits</p>
        <p className='line'>How to update WhatsApp</p>
        <p className='line'>How to change group privacy settings</p>
        <p className='line2'>View all questions</p>
        </div>

    }
}

class Child2 extends React.Component{
    render(){
        return <div>
        <h4>Web and Desktop</h4>
        <p className='line'>About WhatsApp Web and Desktop</p>
        <p className='line'>How to log in or out</p>
        <p className='line'>How to manage your notifications</p>
        <p className='line2'>View all questions</p>
        </div>

    }
}

export default (Child, Child2);
